export default class RouteManager{IsProduction=!1;Routes=[];constructor(t=!1){this.IsProduction=t;let o=this;window.onhashchange=function(){o.Redirect()}}ApplicationContextPath(){let t="";return this.IsProduction||(t=["/",window.location.hostname,window.location.pathname.split("/")[1]].join("/")),t}GetModule(t="",o=""){new Array;return this.ApplicationContextPath()+"/"+[t,o].join("/")}GetParameterURL(t){return new URLSearchParams(window.location.search).get(t)}Redirect(){let t=window.location.hash.substring(1);this.Routes.map((function(o){o.path===t&&(null!=o.element?$(o.element).load(o.contract):window.location.href=o.contract)}))}}